import React from 'react';
import './style.css'

const dataWeb = new Date();

console.log('====================================');
console.log(dataWeb);
console.log('====================================');

const Footer = () => (

    <div id="main-footer">
        <footer className="footer-basic-centered">

            <p className="footer-company-motto">ENgAGED.</p>

            <p className="footer-links">
                <a href=" ">Home</a>
            </p>

            <p className="footer-company-name">
                Todos os direitos reservados &copy {dataWeb.getDay};
            </p>

        </footer>
    </div>
);

export default Footer;
